import Navigation from "./Navigation";
import Social from "./Social";
const year = new Date();
function Footer() {
  return (
    <div className="footer flex">
      <div className="grid">
        <Navigation />
        <Social />
        <p>Copyright &copy; {year.getFullYear()}</p>
      </div>

    </div>
  );
}

export default Footer;
